import React from 'react'
import { Container,Row,Button} from 'reactstrap'
import  {Navlink, Link} from 'react-router-dom'

const nav__links =[
    {
        path:'/home',
        display:'Home'
    },
    {
        path:'/#',
        display:'About'
    },
    {
        path:'/tours',
        display:'Tours'
    },
]


const Header = () => {
    return <header className="header">
        <Container>
            <Row></Row>
        </Container>
    </header>
}



export default Header;
